import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import React from 'react';
import { useForm } from 'react-hook-form';
import CitizenRegistrationInfo from '../../models/citizenRegistration.model';
import '../../styles/Registration.css';
import RegistrationService from '../../services/registration.service';
import history from '../../misc/history';

function CitizenRegistration() {
   let errors = "";

   const { register, handleSubmit } = useForm<CitizenRegistrationInfo>();

   const onSubmit = (data: CitizenRegistrationInfo) => {
      console.log(data);

      RegistrationService.registerCitizen(
         data
      ).then(response => {
         if (response.status === 200) {
            history.push("/");
         } else {
            errors = String(response.data);
         }
      });
   }

   return (
      <div>
         <div className="container">
            <form onSubmit={handleSubmit(onSubmit)}>
               <div className="horizontal-center">
                  <h1>Registracija građanina:</h1>
               </div>
               <div className="horizontal-center">
                  {errors}
               </div>
               <div className="horizontal-center">
                  <TextField id="username" inputRef={register} name="username" label="Korisničko ime" variant="outlined" />
               </div>
               <div className="horizontal-center">
                  <TextField id="email" type="email" inputRef={register} name="email" label="Email adresa" variant="outlined" />
               </div>
               <div className="horizontal-center">
                  <TextField id="password" type="password" inputRef={register} name="password" label="Lozinka" variant="outlined" />
               </div>
               <div className="horizontal-center">
                  <TextField id="firstName" inputRef={register} name="firstName" label="Ime" variant="outlined" />
               </div>
               <div className="horizontal-center">
                  <TextField id="lastName" inputRef={register} name="lastName" label="Prezime" variant="outlined" />
               </div>
               <div className="horizontal-center">
                  <TextField id="phoneNumber" type="tel" inputRef={register} name="phoneNumber" label="Broj telefona" variant="outlined" />
               </div>
               <div className="horizontal-center">
                  <Button type="submit" variant="contained">Registracija</Button>
               </div>
            </form>
         </div>
      </div>
   );
}

export default CitizenRegistration;
